import Link from 'next/link';

const Foot = () => (
  <div id="footer">
    <ul>
      <li><Link href="/"><a>- Home</a></Link></li>
      <li><Link href="/contact"><a>- Get In Touch</a></Link></li>
      <li><Link href="/about"><a>- Learn About Us</a></Link></li>
    </ul>
    <style jsx>{`
      #footer {
        float: left;
        width: 80%;
        background: rgba(0,0,0,.4);
        padding: 10%;
      }
      ul {
        float: left;
        width: 40%;
      }
      li {
        float: left;
        width: 100%;
      }
      li a {
        border-bottom: 2px solid rgba(0,0,0,0);
      }
      li a:hover {
        color: rgba(255,255,255,.6);
        background: none;
        border-bottom: 2px solid #FF6161;
      }

/*  ||||| Mobile device display properties only |||||  */

      @media only screen and (max-device-width: 480px) {
        ul {
          float: left;
          width: 100%;
          position: relative;
        }
        li {
          float: left;
          width: 100%;
        }
        li a {
          float: left;
        }
      }
      `}</style>
  </div>
);

export default Foot;
